import React, {Component} from 'react';
import ReactDOM from 'react-dom';
import {BrowserRouter, Routes, Route} from 'react-router-dom';
import './index.css';
import App from './components/App';
import reportWebVitals from './reportWebVitals';
import Test from './components/Test'

class Renders extends Component {
  state = {routesList : ["testRoute", "testRoute2"]};

  addRoute = (route, category) => {
    this.setState(previousState => ({
      routesList: [...previousState.routesList, route]
  }), console.log(this.state.routesList));
  }

  render() {
    return(<React.StrictMode>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<App callBackFunction={this.addRoute}/>} />
          {this.state.routesList.map((routePoint) => <Route path={["/", routePoint].join("")} element={<Test point={routePoint} exact/>}/>)}
        </Routes>
      </BrowserRouter>
    </React.StrictMode>)
  }
};

ReactDOM.render(
  <Renders/>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
